create table user
(
    id                       BIGINT(19) auto_increment comment 'ID'
        primary key,
    avatar                   VARCHAR(255) null comment '头像地址',
    create_time              DATETIME(19) null comment '创建日期',
    email                    VARCHAR(255) null comment '邮箱',
    enabled                  BIGINT(19)   null comment '状态：1启用、0禁用',
    password                 VARCHAR(255) null comment '密码',
    username                 VARCHAR(255) null comment '用户名',
    last_password_reset_time DATETIME(19) null comment '最后修改密码的日期',
    dept_id                  BIGINT(19)   null,
    phone                    VARCHAR(255) null,
    job_id                   BIGINT(19)   null,
    icon                     VARCHAR(255) null comment '头像',
    mp_open_id               VARCHAR(255) null comment '公众号open id',
    ma_open_id               VARCHAR(255) null comment '小程序open id',
    union_id                 VARCHAR(255) null comment '用户唯一标识符',
    app_id                   VARCHAR(255) null,
    constraint UK_kpubos9gc2cvtkb0thktkbkes
        unique (email),
    constraint username
        unique (username),
    constraint user_ibfk_1
        foreign key (dept_id) references dept (id),
    constraint user_ibfk_2
        foreign key (job_id) references job (id)
);

create index FK5rwmryny6jthaaxkogownknqp
    on user (dept_id);

create index FKfftoc2abhot8f2wu6cl9a5iky
    on user (job_id);

